public class AnagramChecker {

    public static boolean areAnagrams(String str1, String str2) {
        // Create two arrays to store the character counts
        int[] count1 = new int[26];
        int[] count2 = new int[26];

        // Iterate through the characters of the first string and increment the corresponding count
        for (char c : str1.toCharArray()) {
            count1[c - 'a']++;
        }

        // Iterate through the characters of the second string and decrement the corresponding count
        for (char c : str2.toCharArray()) {
            count2[c - 'a']--;
        }

        // Check if the counts are equal
        for (int i = 0; i < 26; i++) {
            if (count1[i] != count2[i]) {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        String str1 = "listen";
        String str2 = "silent";

        if (areAnagrams(str1, str2)) {
            System.out.println("The two strings are anagrams.");
        } else {
            System.out.println("The two strings are not anagrams.");
        }
    }
}

